// App.tsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import Header from './components/Header'; // Importer le composant Header
import Accueil from './pages/Accueil'; // Importer la page Accueil
import Historique from './pages/Historique'; // Importer la page Historique
import CategoriePage from './pages/Categorie'; // Importer la page Categorie

const App: React.FC = () => {
  return (
    <Router>
      <Header />
      <Routes>
        {/* Routes principales */}
        <Route path="/" element={<Accueil />} />
        <Route path="/historique" element={<Historique />} />
        <Route path="/categories" element={<CategoriePage />} />
      </Routes>
    </Router>
  );
};

export default App;
